    # from the given cost matrix
    if m == n:
        return 0
    min_cost = float('inf')
    for i in range(m):
        for j in range(n):
            if i + 1 < m:
                min_cost = min(min_cost, cost[i][j] + min_cost(cost, i + 1, n))
